import "../styles/LandingPage.css"
import {Link} from "react-router-dom";
import bg from "../static/images/landingPic.png"
import { MDBBtn, MDBIcon } from 'mdb-react-ui-kit';


class LandingPage extends Component {

    render() {
        return (

            <div
            style={{
              position: "absolute",
              top: "50%",
              left: "50%",
              transform: "translate(-40%, -60%)"
            }}
          >
              <div class="row">
                <div class="block"> 

                <h1 class="cover-heading">
                    <p>Hello, I'm Paul Miller-Schmidt</p>
                    <p class="h2">Musician | Software Engineer | Educator | Yale CS Grad</p>
                  </h1>

                <p class="lead">
                <Link to="/About" class="btn btn-lg btn-default btn1">Learn More</Link>
                </p>
                <MDBBtn className='m-1' style={{ backgroundColor: '#0082ca' }} href='#'>
        <MDBIcon fab icon='linkedin-in' />
      </MDBBtn>

                </div>
                <div class="block"> 
                {/* <img src={bg} alt="SWE"/> */}
                </div>


                </div>


          </div>
        );
    };


};


export default LandingPage;
